import React from "react";
import "./Education.css";

const Education = () => {
  return (
    <div className="education">
      <h1 className="education-heading">Education</h1>
      <div className="education-container">
        <div className="education-item">
          <h2>Rajagiri School of Engineering & Technology (RSET)</h2>
          <p>BTech in Computer Science and Engineering</p>
          <p>2022 - Present</p>
        </div>
        <div className="education-item">
          <h2>St. Josephâ€™s School, Kuriachira</h2>
          <p>Higher Secondary Education</p>
          <p>2020 - 2022</p>
        </div>
        <div className="education-item">
          <h2>Don Bosco ICSE School, Mannuthy</h2>
          <p>Primary & Secondary Education</p>
          <p>2008 - 2020</p>
        </div>
      </div>
    </div>
  );
};

export default Education;
